import React from 'react'
import Autocomplete from '@material-ui/lab/Autocomplete';
import CheckBoxOutlineBlankIcon from '@material-ui/icons/CheckBoxOutlineBlank';
import CheckBoxIcon from '@material-ui/icons/CheckBox';
import Checkbox from '@material-ui/core/Checkbox';
import {TextField, InputAdornment} from '@material-ui/core';
import { Redirect } from 'react-router-dom'; // add this import 

// Top 100 films as rated by IMDb users. http://www.imdb.com/chart/top
const top100Films = [
    { home: 'Home', route: "/"},
    { home: 'Profile', route: "/profile"},
    { home: 'Account', route: "/accounts"},
    { home: 'Expense', route:"/expense"},
    { home: 'Tags', route: "/tags"},
  ];

export class Search extends React.Component {


    redirect(route) {
        console.log(route)
        return <Redirect to='/'/>
        // if(route === 'Home'){}
        // else if(route === 'Profile'){return <Redirect to='/profile'/>}
    }

    render() {
        console.log(this.props)
        return(
            <form class="search-form">
                <div class="input-group">
                    <div class="input-group-prepend">
                    <div class="input-group-text">

                    </div>
                    </div>
                    <Autocomplete
                        multiple
                        id="free-solo-demo"
                        freeSolo
                        options={top100Films}
                        disableCloseOnSelect
                        getOptionLabel={(option) => option.home}
                        onChange={(event,input)=>{
                            this.redirect(event.target.innerText)
                        }}
                        renderOption={(option, { selected }) => (
                            <React.Fragment>
                                <div>
                                    {option.home}
                                </div>
                            </React.Fragment>
                        )}
                        style={{ width: 500 }}
                        renderInput={(params) => (
                            <TextField {...params} placeholder="Search"  InputProps={{...params.InputProps, disableUnderline: true, startAdornment: (<InputAdornment position="start"><i data-feather="search"></i> </InputAdornment> ) }}/>
                        )}
                        />
                </div>
            </form>
        );
    }
}

export default Search
